import React, { Component } from "react";
import { Link } from "react-router-dom";
import Header from "../components/Header";
import Nav from "../components/Nav";
import Modal from "../components/Modal";
import Close from "../components/Close";
import Search from "../components/Search";
import Loginbox from "../components/LogInForms";

function HorrorNav(props) {
    return (
      <Nav> 
        <a href="/">Home</a>
        <a href="#">MY PROFILE</a>
        <button type="button" onClick={props.onSearch} className="toSearch">SEARCH</button>
      </Nav>
    )
  }

function LogInScreen(props) {
    return (
        <Loginbox>
           <div className="box">
                <div className="buttonshere">
                    <button type="button" className="logbutton">Log In</button>
                    <button type="button" className="logbutton" id="not">Sign Up</button>
            </div>  
                <input type="text" className="username" name="username" placeholder="username"></input>
                <br></br>
                <input type="text" className="username" name="password" placeholder="password"></input>
                <br></br>
                <button type="button" className="logingo">Log In</button>
            </div> 
        </Loginbox>
    )
}
  

class LogIn extends Component {
    state = {
        isOpen: false
    };

    handleOnSearch = (event) => {
        this.setState ({ isOpen: true })
      };
    
      handleOnClose = (event) => {
        this.setState ({ isOpen: false })
      };


render() {
    return (
        <React.Fragment>
              <Header />
              <HorrorNav onSearch={this.handleOnSearch} /> 
              <Modal isOpen={this.state.isOpen}>
                <Close onClick={this.handleOnClose}/>
                <Search />
              </Modal>
              <Loginbox />
                
              
              
              
      </React.Fragment>
    );
}

}

export default LogIn;
